import React from 'react';
import {Link} from "react-router-dom";
const Homenav = () => {
    return(
        <div>
            <li>
                <Link to ="/">Home</Link>
            </li>
            <li>
                <Link to ="/">Features</Link>
            </li>
            <li>
                <Link to ="/">WorkFlow</Link>
            </li>
            <li>
                <Link to ="/">Pricing</Link>
            </li>
        </div>
    )
}
export default Homenav;
